import './App.css';
import React from 'react'
import Navbar from './myComponent/Navbar';
import News from './myComponent/News';
import Footer from './myComponent/Footer';
import {BrowserRouter as Router, Routes, Route} from "react-router-dom";
const App=()=> {

    return (
      <div>

        <Navbar/>

        <Routes>
        <Route path="/" element={<News size={6} country="in" category="general"/>}/>
        <Route path="/sport" element={<News size={6} country="in" category="sport"/>} />
        </Routes>

        <Footer/>
      </div>

    )

}
export default App;
